	"sap/fe/macros/DraftIndicator.fragment.xml":'<core:FragmentDefinition xmlns:template="http://schemas.sap.com/sapui5/extension/sap.ui.core.template/1" xmlns:core="sap.ui.core" xmlns="sap.m" template:require="{FIELD:\'sap/fe/macros/field/FieldHelper\'}"><template:if test="{= ${this&gt;DraftIndicatorType} === \'IconAndText\'}"><template:then><ObjectMarker core:require="{DraftIndicator:\'sap/fe/macros/DraftIndicatorRuntime\'}" type="{= !%{IsActiveEntity} ? \'Draft\' : (%{HasDraftEntity} ? (%{DraftAdministrativeData/InProcessByUser} ? \'LockedBy\' : (%{DraftAdministrativeData/LastChangedByUser} ? \'UnsavedBy\' : \'Unsaved\')) : \'Flagged\') }" press="DraftIndicator.onDraftLinkPressed($event, \'{entitySet&gt;@sapui.name}\',\'{this&gt;indicatorType}\')" visibility="{= !%{HasDraftEntity} ? \'TextOnly\' : \'IconAndText\' }" visible="{= !${IsActiveEntity} || ${HasDraftEntity}}" additionalInfo="{path:\'entitySet&gt;$Type\',formatter:\'FIELD.getBindingForDraftAdminBlockInline\'}"/></template:then><template:else><ObjectMarker core:require="{DraftIndicator:\'sap/fe/macros/DraftIndicatorRuntime\'}" type="{= !%{IsActiveEntity} ? \'Draft\' : (%{HasDraftEntity} ? (%{DraftAdministrativeData/InProcessByUser} ? \'Locked\' : \'Unsaved\') : \'Flagged\') }" press="DraftIndicator.onDraftLinkPressed($event, \'{entitySet&gt;@sapui.name}\',\'{this&gt;indicatorType}\')" visibility="IconOnly" visible="{= !(${ui&gt;/editMode} === \'Editable\') &amp;&amp; ${HasDraftEntity} }" class="${this&gt;class}"/></template:else></template:if></core:FragmentDefinition>',
